void cStyleComments() 
{
  int c;
  while(1) {
    while((c = input()) != '*'){ 
      if(c == '\n') getdp_yylinenum++; 
      if(feof(getdp_yyin)) {
	Msg::Error("End of file in commented region");
        exit(1);
      }
    } 
    if((c = input()) == '/') return;
    unput(c);
  }
}

